import React from "react";

const Features = () => {
  return (
    <div className="mt-10 max-sm:mt-40">
      <h1 className="text-5xl max-sm:text-4xl font-medium">Why Choose Kode?</h1>
      <p className="text-gray-200 mt-3">
        At Kode, we believe that coding competitions should be more than just
        challengesâ€”they should be a seamless, innovative experience where
        fairness meets creativity. Here's what sets us apart:
      </p>
      <div className="flex items-center gap-5 mt-8 justify-center flex-wrap">
        <div className="h-[25em] w-[37.7em] bg-gray-300 rounded-xl"></div>
        <div className="h-[25em] w-[37.7em] bg-gray-300 rounded-xl"></div>
      </div>
      <div className="flex items-center gap-5 mt-5 justify-center flex-wrap">
        <div className="flex flex-col gap-5">
          <div className="h-[25em] w-[37.7em] bg-gray-300 rounded-xl"></div>
          <div className="h-[25em] w-[37.7em] bg-gray-300 rounded-xl"></div>
        </div>
        <div className="h-[55em] w-[37.7em] bg-gray-300 rounded-xl"></div>
      </div>
    </div>
  );
};

export default Features;
